#include <string.h>
int lengthOfLongestSubstring(char* s) {
    
    int k=0;
    int len=strlen(s);
    int an=1;
    char ans[100010]={0};
    if (len == 0) an=0;
    for (int j=0; j<len-1; j++)
    {
        
	memset(ans,0,100010);
	k=0;
        //an=0;
	ans[k++]=s[j];
	for (int i=j+1;i<len; i++)
	{
		if (strchr(ans,s[i])==NULL) 
		{
			ans[k++]=s[i];
			if (strstr(s,ans)==NULL) ans[--k]=0;
                	if (k>an) an = k;
		}
	}
        if (k>=('~'-'a')) break;
    }
    return an;
}
